string ltrim(const string &str) {
//	{{{
    string s(str);
    auto it = std::find_if(s.begin(), s.end(),
                    [](char c) {
                        return !std::isspace<char>(c, std::locale::classic());
                    });
    s.erase(s.begin(), it);
    return s;
}
//	}}}
string rtrim(const string &str) {
//	{{{
    string s(str);
    auto it = std::find_if(s.rbegin(), s.rend(),
                    [](char c) {
                        return !std::isspace<char>(c, std::locale::classic());
                    });
    s.erase(it.base(), s.end());
    return s;
}
//	}}}
vector<string> split(const string &str, const char delim=' ') {
//	{{{
    vector<string> tokens;
    string::size_type start = 0;
    string::size_type end = 0;
    while ((end = str.find(delim, start)) != string::npos) {
        tokens.push_back(str.substr(start, end - start));
        start = end + 1;
    }
    tokens.push_back(str.substr(start));
    return tokens;
}
//	}}}
template <typename T>
string join(const vector<T> words, const char delim=' ') {
	//	{{{
	string result = "";
	for (int i = 0; i < words.size(); ++i) {
		result += std::to_string(words[i]);
		if (i != words.size()-1) { result += delim; }
	}
	return result;
}
	//	}}}
template <typename T>
void printVector(string varname, const vector<T> words, const char delim=' ') {
	//	{{{
	string vector_str = join(words, delim);
	cerr << varname << "=(" << vector_str << ")\n";
}
	//	}}}
template <typename A, typename B>
void printMap(string varname, const map<A,B> m, const char delim=' ') {
	//	{{{
	string m_str = "";
	for (auto const &x: m) {
		m_str += std::to_string(x.first);
		m_str += ":";
		m_str += std::to_string(x.second);
		m_str += delim;
	}
	m_str.pop_back();
	cerr << varname << "=(" << m_str << ")\n";
}
	//	}}}
//	}}}

vector<int> combinationpairs_deltas(vector<int> arr) 
	//	{{{
{
	vector<int> result;
	int n = arr.size();
	int r = 2;
	vector<bool> temp(n);
	fill(temp.end()-r, temp.end(), true);
	do {
		vector<int> new_combination;
		int A = INT_MAX;
		int B = INT_MAX;
		for (int i = 0; i < n; ++i) {
			if (temp[i]) {
				if (A == INT_MAX) {
					A = arr[i];
				} else if (B == INT_MAX) {
					B = arr[i];
					break;
				} 
			}
		}
		int loop_delta = abs(A-B);
		result.push_back(loop_delta);
	} 
	while (next_permutation(temp.begin(), temp.end()));
	return result;
}
	//	}}}

void combinationpairs_deltas_Backtracking_helper(vector<int>& result, const vector<int>& values, int start, vector<int>& cur, int n)
{
	if (cur.size() == n) {
		result.push_back( abs(cur[1] - cur[0] ) );
		return;
	}
	for (int i = start; i < values.size(); ++i) {
		cur.push_back(values[i]);
		combinationpairs_deltas_Backtracking_helper(result, values, i+1, cur, n);
		cur.pop_back();
	}
}

vector<int> combinationpairs_deltas_Backtracking(const vector<int>& arr)
{
	int n = 2;
	vector<int> result;
	vector<int> temp;
	combinationpairs_deltas_Backtracking_helper(result, arr, 0, temp, n);
	return result;
}

int minimumAbsoluteDifference_i(vector<int> arr)
{
	//vector<int> deltas = combinationpairs_deltas(arr);
	vector<int> deltas = combinationpairs_deltas_Backtracking(arr);
	return *min_element(deltas.begin(), deltas.end());
}

int minimumAbsoluteDifference_ii(vector<int> arr)
{
	stable_sort(arr.begin(), arr.end());
	vector<int> deltas(arr.size()-1);
	for (int i = 1; i < arr.size(); ++i) {
		deltas[i-1] = arr[i] - arr[i-1];
	}
	return *min_element(deltas.begin(), deltas.end());
}


